import React, { Component } from 'react';

import { Footer, Columns, Container, Tile, Heading } from 'react-bulma-components';

class AbakkusFooter extends Component {
    render() {
        return (
            <Footer>
                <Container>
                    <Columns>
                        <Columns.Column>
                            <Tile renderAs="article" kind="child" notification color="primary" >
                                <Heading>Vertical...</Heading>
                                <Heading subtitle>Top tile</Heading>
                            </Tile>
                        </Columns.Column>
                    </Columns>
                </Container>
                <Container style={{ textAlign: 'center' }}>
                    LLP - Copyright Â© 2020 Abakkus Asset Manager LLP | All Rights Reserved
                </Container>
            </Footer>
        )
    }
}

export default AbakkusFooter;
